SELECT MIN("lineorder"."lo_revenue" + "dim_date"."d_weekdayfl") as agg_0, MIN("lineorder"."lo_quantity" + "dim_date"."d_weekdayfl") as agg_1, COUNT(*) as agg_2 FROM "supplier" LEFT OUTER JOIN "lineorder" ON "supplier"."s_suppkey" = "lineorder"."lo_suppkey" LEFT OUTER JOIN "dim_date" ON "lineorder"."lo_orderdate" = "dim_date"."d_datekey" LEFT OUTER JOIN "customer" ON "lineorder"."lo_custkey" = "customer"."c_custkey"  WHERE "lineorder"."lo_partkey" BETWEEN 71805 AND 122372 AND "supplier"."s_region" NOT LIKE '%EAST%'